import{u as s,c as t,p as o,e as i,m as e,a,ab as c,o as l}from"./chunks/framework.CUflZczI.js";const d=e("h1",{id:"щотижневии-дзвінок-спільноти-q-a-call-раніше-dev-call",tabindex:"-1"},[a('Щотижневий дзвінок спільноти Q&A Call (Раніше "Dev Call") '),e("a",{class:"header-anchor",href:"#щотижневии-дзвінок-спільноти-q-a-call-раніше-dev-call","aria-label":'Permalink to "Щотижневий дзвінок спільноти Q&A Call (Раніше "Dev Call")"'},"​")],-1),n={key:0},_=e("div",{class:"custom-block danger"},[e("p",{class:"custom-block-title"},[a("Ця сторінка може бути застарілою. "),e("a",{href:"https://docs.px4.io/main/en/contribute/dev_call.html"},"Подивіться останню версію"),a(".")])],-1),h=[_],u=c('<p>Команда розробників PX4 і спільнота збираються разом, щоб обговорити будь-яку тему, яка цікавить спільноту, починаючи від вирішення проблем і закінчуючи задоволенням вашої цікавості.</p><h2 id="хто-повинен-відвідувати-ці-дзвінки" tabindex="-1">Хто повинен відвідувати ці дзвінки? <a class="header-anchor" href="#хто-повинен-відвідувати-ці-дзвінки" aria-label="Permalink to &quot;Хто повинен відвідувати ці дзвінки?&quot;">​</a></h2><ul><li>Основні розробники проєкту PX4</li><li>Розробники компонентів</li><li>Test team lead</li><li>Учасники Dronecode</li><li>Члени спільноти (ви!)</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Запитання та відповіді спільноти відкритий для всіх зацікавлених учасників спільноти.</p><p>Це чудова можливість зустрітися з командою і зробити свій внесок у розвиток платформи.</p></div><h2 id="що-буде-обговорюватись" tabindex="-1">Що буде обговорюватись? <a class="header-anchor" href="#що-буде-обговорюватись" aria-label="Permalink to &quot;Що буде обговорюватись?&quot;">​</a></h2><p>Ми розміщуємо пост на конкретну зустріч за тиждень до дзвінка про <a href="https://discuss.px4.io/c/weekly-dev-call" target="_blank" rel="noreferrer">PX4 Discuss - тижневий виклик</a> та відслідковуємо обговорення за добу до запланованого дзвінка. Ми будемо раді будь-яким темам, про які ви, як учасник спільноти хочете задати питання чи просто обговорити!</p><p>Будь ласка, додайте ваші теми для обговорення до порядку денного перед початком зустрічі, відповівши на нотатку зустрічі. Це допоможе вам сформулювати ваші запитання більш чітко, і дозволить нам подумати про них заздалегідь.</p><h2 id="розклад" tabindex="-1">Розклад <a class="header-anchor" href="#розклад" aria-label="Permalink to &quot;Розклад&quot;">​</a></h2><ul><li>Час: середа 17h00 CET (<a href="https://www.dronecode.org/calendar/" target="_blank" rel="noreferrer">підписатись на календар</a>)</li><li><strong>Приєднуйтесь до дзвінка</strong>: <a href="https://discord.gg/BDYmr6FA6Q" target="_blank" rel="noreferrer">https://discord.gg/BDYmr6FA6Q</a></li></ul>',9),v=JSON.parse('{"title":"Щотижневий дзвінок спільноти Q&A Call (Раніше \\"Dev Call\\")","description":"","frontmatter":{},"headers":[],"relativePath":"uk/contribute/dev_call.md","filePath":"uk/contribute/dev_call.md"}'),p={name:"uk/contribute/dev_call.md"},g=Object.assign(p,{setup(m){const{site:r}=s();return(b,f)=>(l(),t("div",null,[d,o(r).title!=="PX4 Guide (main)"?(l(),t("div",n,h)):i("",!0),u]))}});export{v as __pageData,g as default};
